    render(){
        return(
            <Grid container spacing={2}>
                <Grid item xs={12}>
                    <Paper className={classes.paper}>xs=12</Paper>
                </Grid> 
            <div>
                <AllPosts></AllPosts>
            </div>
            </Grid>
        )
    }
}

export default HomePageComponent
